window.bookSummaryJSON = "<p>“You don’t belong.”&nbsp;</p> <p>No words whispered in anger have ever rung more true.&nbsp;</p> <p>They’re the Kings of Brayshaw with the world at their feet, destined for greatness and in need of control. I’m the girl from the ghetto with nothing to offer and as defiant as they come.&nbsp;</p> <p>They say it doesn’t matter, that I’m one of them now, and nothing could ever change that. Not even me, should I dare try.&nbsp;</p> <p>But they’re wrong. <br> They underestimate how far I’ll go to protect them.&nbsp;</p> <p>Trouble is coming...and they have no idea.</p> <p><b><i>Trouble at Brayshaw High</i></b><b> is the the highly anticipated follow-up to </b><b><i>Boys of Brayshaw High</i></b><b>, and should be heard only after having listened to book one.</b></p>"; 
